struct Vertex{
	glm::vec3 pos;
	glm::vec3 normal;
	glm::vec2 texturePos;
	void normalize() {
		pos = glm::normalize(pos);
		normal = glm::normalize(normal);
	}
};

struct Triangle {
	Vertex A;
	Vertex B;
	Vertex C;

	Triangle(glm::vec3 t, glm::vec3 u, glm::vec3 v) {
		glm::vec3 normal = glm::cross((u-t), (v-t));
		A.normal = normal;
		A.pos = t;
		B.normal = normal;
		B.pos = u;
		C.normal = normal;
		C.pos = v;
	}

	//c++11 has some nice features. 
	Triangle() = default;

	void normalize() {
		A.normalize();
		B.normalize();
		C.normalize();
	}
};

struct Sphere{
	private:
		std::vector<Triangle> triangles;
		unsigned int faceSubDivisions = 4;
		unsigned int VBO, VAO;//, EBO;  maybe I'll add an EBO later when I'm reducing memory overhead. 
		Sphere() {
			int totalTriangles = 8 * std::pow(4,faceSubDivisions);
			//face octant 1 +-+
			generateSubTriangles(Triangle(glm::vec3( 1.0f, 0.0f, 0.0f),glm::vec3( 0.0f, 0.0f,-1.0f),glm::vec3( 0.0f, 1.0f, 0.0f)),faceSubDivisions);
			//face octant 2 --+
			generateSubTriangles(Triangle(glm::vec3( 0.0f, 0.0f,-1.0f),glm::vec3(-1.0f, 0.0f, 0.0f),glm::vec3( 0.0f, 1.0f, 0.0f)),faceSubDivisions);
			//face octant 3 -++
			generateSubTriangles(Triangle(glm::vec3(-1.0f, 0.0f, 0.0f),glm::vec3( 0.0f, 0.0f, 1.0f),glm::vec3( 0.0f, 1.0f, 0.0f)),faceSubDivisions);
			//face octant 4 +++
			generateSubTriangles(Triangle(glm::vec3( 0.0f, 0.0f, 1.0f),glm::vec3( 1.0f, 0.0f, 0.0f),glm::vec3( 0.0f, 1.0f, 0.0f)),faceSubDivisions);
			
			//face octant 5 
			generateSubTriangles(Triangle(glm::vec3( 1.0f, 0.0f, 0.0f),glm::vec3( 0.0f, -1.0f, 0.0f),glm::vec3( 0.0f, 0.0f,-1.0f)),faceSubDivisions);
			//face octant 6 --+
			generateSubTriangles(Triangle(glm::vec3( 0.0f, 0.0f,-1.0f),glm::vec3( 0.0f, -1.0f, 0.0f),glm::vec3(-1.0f, 0.0f, 0.0f)),faceSubDivisions);
			//face octant 7 -++
			generateSubTriangles(Triangle(glm::vec3(-1.0f, 0.0f, 0.0f),glm::vec3( 0.0f, -1.0f, 0.0f),glm::vec3( 0.0f, 0.0f, 1.0f)),faceSubDivisions);
			//face octant 8 +++
			generateSubTriangles(Triangle(glm::vec3( 0.0f, 0.0f, 1.0f),glm::vec3( 0.0f, -1.0f, 0.0f),glm::vec3( 1.0f, 0.0f, 0.0f)),faceSubDivisions);

			for(std::vector<Triangle>::iterator curr = triangles.begin(); curr < triangles.end(); curr++){
				curr->normalize();
				// if(glm::dot(curr->A.pos, curr->A.normal) < 0) {
				// 	curr->A.normal *= -1.0;
				// 	curr->B.normal *= -1.0;
				// 	curr->C.normal *= -1.0;
				// }
				curr->A.normal = curr->A.pos;
				curr->B.normal = curr->B.pos;
				curr->C.normal = curr->C.pos;

				curr->A.texturePos = glm::vec2(0.0f);
				curr->B.texturePos = glm::vec2(0.0f);
				curr->C.texturePos = glm::vec2(0.0f);
			}


			glGenBuffers(1, &VBO);
			glGenVertexArrays(1, &VAO);
			//glGenBuffers(1, &EBO);

			glBindVertexArray(VAO);

			glBindBuffer(GL_ARRAY_BUFFER, VBO);
			glBufferData(GL_ARRAY_BUFFER, sizeof(Vertex) * triangles.size() * 3, &triangles[0], GL_STATIC_DRAW);

    		glEnableVertexAttribArray(0);	
			glVertexAttribPointer(0,3, GL_FLOAT, GL_FALSE, sizeof(Vertex), (void*)0);

    		glEnableVertexAttribArray(1);	
			glVertexAttribPointer(1,3, GL_FLOAT, GL_FALSE, sizeof(Vertex), (void*)offsetof(Vertex, normal));

			glEnableVertexAttribArray(2);	
			glVertexAttribPointer(2,3, GL_FLOAT, GL_FALSE, sizeof(Vertex), (void*)offsetof(Vertex, texturePos));

			glBindVertexArray(0);

		}
		/*	ParentTriangle is the source to generate sub triangles from
			subDivisionsRemaing is a depthCounter
			returns the number of triangles int outputTriangles*/
		void generateSubTriangles(Triangle ParentTriangle, int subDivisionsRemaining) {
			glm::vec3 newPointA = ((ParentTriangle.B.pos - ParentTriangle.A.pos) * 0.5f) + ParentTriangle.A.pos;
			glm::vec3 newPointB = ((ParentTriangle.C.pos - ParentTriangle.B.pos) * 0.5f) + ParentTriangle.B.pos;
			glm::vec3 newPointC = ((ParentTriangle.C.pos - ParentTriangle.A.pos) * 0.5f) + ParentTriangle.A.pos;

			Triangle triangeA = Triangle(ParentTriangle.A.pos,newPointA,newPointC);
			Triangle triangeB = Triangle(newPointA,ParentTriangle.B.pos,newPointB);
			Triangle triangeC = Triangle(newPointB,ParentTriangle.C.pos,newPointC);
			Triangle triangeD = Triangle(newPointA,newPointB,newPointC);
			subDivisionsRemaining--;
			if(subDivisionsRemaining > 0) {
				int tCountA, tCountB, tCountC, tCountD;
				generateSubTriangles(triangeA, subDivisionsRemaining);
				generateSubTriangles(triangeB, subDivisionsRemaining);
				generateSubTriangles(triangeC, subDivisionsRemaining);
				generateSubTriangles(triangeD, subDivisionsRemaining);
			} else{
				triangles.push_back(triangeA);
				triangles.push_back(triangeB);
				triangles.push_back(triangeC);
				triangles.push_back(triangeD);
			}
		}
		
	public:
		static Sphere* getInstance() {
			static Sphere steve;
			return &steve;
		}
		
		void draw(Shader *shader){
			shader->use();
			//std::cout<<__LINE__<<std::endl;
			glBindVertexArray(VAO);
			//std::cout<<__LINE__<<std::endl;
			glDrawArrays(GL_TRIANGLES, 0, triangles.size() * 3);  //3456
			//std::cout<<__LINE__<<std::endl;
			glBindVertexArray(0);
			//std::cout<<__LINE__<<std::endl;
		}

		~Sphere() {
			glDeleteVertexArrays(1, &VAO);
			glDeleteBuffers(1, &VBO);
		}
};

